package ViewVO;

public class ScrapEventViewVO {
	private String scrapCode;
	private String recipeCode;
	private String userCode;
	private String postCode;
	private String scrapDate;
	private String userName;
	private String userImage;
	private String scrapUserName;
	private String completeImage;
	private String recipeName;
	private String recipeDescription;
	private String scrapUserImage;
	public ScrapEventViewVO() {
		// TODO Auto-generated constructor stub
	}
	public ScrapEventViewVO(String scrapCode, String recipeCode,
			String userCode, String postCode, String scrapDate,
			String userName, String userImage, String scrapUserName,
			String completeImage, String recipeName, String recipeDescription,
			String scrapUserImage) {
		this.scrapCode = scrapCode;
		this.recipeCode = recipeCode;
		this.userCode = userCode;
		this.postCode = postCode;
		this.scrapDate = scrapDate;
		this.userName = userName;
		this.userImage = userImage;
		this.scrapUserName = scrapUserName;
		this.completeImage = completeImage;
		this.recipeName = recipeName;
		this.recipeDescription = recipeDescription;
		this.scrapUserImage = scrapUserImage;
	}
	public String getScrapCode() {
		return scrapCode;
	}
	public void setScrapCode(String scrapCode) {
		this.scrapCode = scrapCode;
	}
	public String getRecipeCode() {
		return recipeCode;
	}
	public void setRecipeCode(String recipeCode) {
		this.recipeCode = recipeCode;
	}
	public String getUserCode() {
		return userCode;
	}
	public void setUserCode(String userCode) {
		this.userCode = userCode;
	}
	public String getPostCode() {
		return postCode;
	}
	public void setPostCode(String postCode) {
		this.postCode = postCode;
	}
	public String getScrapDate() {
		return scrapDate;
	}
	public void setScrapDate(String scrapDate) {
		this.scrapDate = scrapDate;
	}
	public String getUserName() {
		return userName;
	}
	public void setUserName(String userName) {
		this.userName = userName;
	}
	public String getUserImage() {
		return userImage;
	}
	public void setUserImage(String userImage) {
		this.userImage = userImage;
	}
	public String getScrapUserName() {
		return scrapUserName;
	}
	public void setScrapUserName(String scrapUserName) {
		this.scrapUserName = scrapUserName;
	}
	public String getCompleteImage() {
		return completeImage;
	}
	public void setCompleteImage(String completeImage) {
		this.completeImage = completeImage;
	}
	public String getRecipeName() {
		return recipeName;
	}
	public void setRecipeName(String recipeName) {
		this.recipeName = recipeName;
	}
	public String getRecipeDescription() {
		return recipeDescription;
	}
	public void setRecipeDescription(String recipeDescription) {
		this.recipeDescription = recipeDescription;
	}
	public String getScrapUserImage() {
		return scrapUserImage;
	}
	public void setScrapUserImage(String scrapUserImage) {
		this.scrapUserImage = scrapUserImage;
	}
	
	

}
